import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";
const Listdata = (props) => {
  return (
    <>
      <div className="todostyle">
        <span>
          <DeleteIcon />
        </span>
        <li>{props.data}</li>;
      </div>
    </>
  );
};

export default Listdata;
